VALUES ('8480017268242', 'Queso fresco', 'ES Queso fresco. Ingredientes: leche de vaca pasterizada, sal, conservador (E202) y coagulante microbiano. Conservar refrigerado entre 1 °C y 4°C. Una vez abierto consumir preferentemente antes de 72 horas. Lote:/Fecha de caducidad : ver envase. PT Queijo fresco gordo. Ingredientes: leite de vaca pasteurizado, sal, conservante (E202) e coagulante microbiano. Conservar em refrigeração entre 1 °C e 4 °C Após abertura, consumir de preferência no prazo de 72 horas. Lote:/Consumir até: ver embalagem. FR Fromage frais. Ingrédients: lait de vache pasteurisé, sel, conservateur (E202) et coagulant microbien. A conserver réfrigéré entre 1°C et +4°C. Après ouverture, à consommer dans les 72 heures. Nutrition: Valeurs énergétiques et nutritionnelles moyennes pour 100 g: Energie: 766 kJ/184 kcal - Matières grasses: 14,0 g (dont acides gras saturés : 9,5 g)-Glucides: 3,6 g (dont sucres: 3,6 g)- Protéines: 11,0 g - Sel : 0,80 g.', 'https://static.openfoodfacts.org/images/products/848/001/726/8242/front_en.14.400.jpg', '14.2', '9.52', '3.71', '3.71', '', '11.1', '0.806', '0.318', '', '1');

