VALUES ('8480017334138', 'Le Cannelloni à la Napolitaine (Pur Bœuf)', 'SAUCE : eau, purée de tomate mi-réduite, viande bovine, amidon transformé de maïs, sucre, sel, arômes (dont céleri).    PÂTE : semoule de blé dur, eau, blanc d\'œuf. FARCE : viande bovine, chapelure (farine de blé, sel), légumes (carotte, oignon), semoule de blé dur, plantes aromatiques, fécule de manioc, blanc d\'œuf, poudre de lait écrémé, sel, huile de tournesol, arômes.  Viande bovine mise en oeuvre : 13 % du poids net total.', 'https://static.openfoodfacts.org/images/products/848/001/733/4138/front_fr.8.400.jpg', '3.5', '', '12.8', '', '', '4.7', '', '', '', '1');

